pragma solidity ^0.4.19;

contract CarreraDeCaballos {

    struct Caballo {
        address id; //address;
        string nombreCaballo;
        string nombreJinete;
        uint edadCaballo;
        uint edadJinete;
        uint carrerasGanadas;
        uint carrerasTotales;
    }

    uint contador = 0;
    uint randNonce = 0;
    
    Caballo[] public listaCaballos;

    event MostrarResultado(string ms, uint res);

    mapping (address => uint) public numeroCaballosPersona;

    //Solo se puede tener un caballo por cuenta
    modifier restriccion() {
        require(numeroCaballosPersona[msg.sender] < 1, "Solo se puede añadir un caballo por persona");
        _;
    }

    //Añadir caballo al array caballos
    function anadirCaballo(string memory _nombreCaballo, string memory _nombreJinete, uint _edadCaballo, uint _edadJinete) public restriccion returns (uint) {
        listaCaballos.push(Caballo(msg.sender, _nombreCaballo, _nombreJinete, _edadCaballo, _edadJinete, 0, 0));
        numeroCaballosPersona[msg.sender]++;
        contador++;
        return contador - 1;
    }

    //A la hora de apostar, se debe hacer con Wei, para ver esa subida de precio con numeros altos
   function Apostar(uint dineroApostar) payable public returns(string memory) {
       require(msg.value == dineroApostar);
        randNonce++;
        uint256 result = uint256(keccak256(abi.encodePacked(now, listaCaballos.length, randNonce))) % listaCaballos.length;
        
        for (uint256 i = 0; i < listaCaballos.length; i++) {
            if (result == i) {
                if (msg.sender == listaCaballos[i].id) {
                    Balance();
                    return "Has ganado";
                } else {
                    emit MostrarResultado("El caballo ganador es: ", result);
                    return "Has perdido";
                }
                listaCaballos[i].carrerasGanadas++;
            }
            listaCaballos[i].carrerasTotales++;
        }    
   }

    //Devuelve el dinero en caso de que se gane
    function Balance() private {
        msg.sender.transfer(address(this).balance + address(this).balance);
    }
}
